import axios from 'axios';
import { useEffect, useState } from "react";
export function Profile() {
    const [imagePaths, setImagePaths] = useState([]);

    useEffect(() => {
        axios.get("http://127.0.0.1:8000/api/v1/Users")
            .then(response => {
                setImagePaths(response.data); // предполагается, что response.data возвращает массив объектов с данными
            })
            .catch(error => {
                console.error('Error fetching data:', error);
                // обработка ошибки, например, установка значения по умолчанию или вывод сообщения об ошибке
            });
    }, []);

    return (
        <div className="avatar">
            {imagePaths.map((elem, index) => (
                <div key={index}>
                    {console.log(elem.avatar)}
                    <img src={elem.avatar} alt={`Avatar ${index}`} />
                </div>
            ))}
        </div>
    );
}
